import React from "react";
import '../css/SideNav.css';

const SideNav = (props) => {
  return (
    <div className="sidenav">
      <a href="#section">Login</a>
      <a href="/Login">About</a>
      <a href="#section">Clients</a>
      <a href="#section">Contact</a>
    </div>
  );
};
export default SideNav;
